import { Layout } from './components/Layout';
import { Box, ChakraProvider, useMenuState } from '@chakra-ui/react'
import { Card } from './components/Card';
import { BrowserRouter, Routes, Route } from 'react-router-dom';



function App() {


  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={
          <ChakraProvider>
          <Layout>
            <Box padding="25px">
              <Card />
            </Box>
          </Layout>
        </ChakraProvider>
        }/>
        <Route path='/conta' element={
          <h1>Conta</h1>
        }/>
      </Routes>
    </BrowserRouter>

  );
}

export default App;
